import React from 'react';
import {useDispatch, useSelector} from 'react-redux';
import './App.css';

function App() {
	const session = useSelector(state => state.session);
	return (
		<div className="App">
			<header className="App-header">
				<h1>{session.username}</h1>
				<h3>{session.email}</h3>

			</header>
		</div>
	);
}

export default App;
